const currencies = [
    "USD", "EUR", "BLUR", "bNEO", "BUSD", "ETH", "GMX", "STEVMOS",
    "LUNA", "RATOM", "STRD", "EVMOS", "IBCX", "IRIS", "ampLUNA", "KUJI", "STOSMO",
    "USDC", "ATOM", "STATOM", "OSMO", "rSWTH", "STLUNA", "LSI", "OKB", "OKT",
    "SWTH", "USC", "WBTC", "wstETH", "YieldUSD", "ZIL"
   ];

   const currencyToSvgPath = currencies.reduce((acc, currency) => {
    acc[currency] = `./tokens/${currency}.svg`;
    return acc;
   }, {});

   export default currencyToSvgPath;
